import React from "react";

import { Product } from "./Product";
import { PRODUCTS } from '../Productsfront'; 
import "./Shop.css";

export const Shop = () => {
  return (
    <div className="shop">

      <div className="products">
        {PRODUCTS.map((product) => (
          <Product data={product} />
        ))}
      </div>
    </div>
  );
};
